  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Tule Lake National
  Wildlife Refuge outlines Refuge accomplishments from August through October of 1938.
  The report begins by summarizing the weather conditions during this period. Wildlife-
  including migratory birds, upland game birds, furbearers, and predators- is also
  covered. The Refuge development and maintenance section discusses physical developments
  and plantings. Resource management is outlined; topics include haying. A progress
  report on field investigations and applied research is also provided. The public
  relations section of the report describes Refuge visitors, hunting, and violations.
  Photographs are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
